import React from 'react'
import {Container, Nav, Navbar, Row} from 'react-bootstrap';
import Product from '../components/Product';

const Home = (props) => {
    const {shoes} = props
  return (
    <>
     

      <div className="slider"></div>

      <Container>
      <Row>
        {
          shoes.map((value, i)=>
              <Product shoes = {value}
              key={i}/>
            )
          }
        
        
      </Row>
    </Container>
    </>
  )
}

export default Home
